import React from "react";
import { Form, Button, Container, Row, Col } from "react-bootstrap";
import moment from "moment";

const TripForm = ({ onSubmit }) => {
  // Remove the state variables and set static variables:
  const startLocation = "123 Main St, Anytown, USA";
  const pickupLocation = "O'Hare Airport, Chicago, IL";
  const dropoffLocation = "Long Beach Port, CA";
  const currentCycleHours = 68.5;
  const startDate = "2024-01-10";

  const handleSubmit = async (event) => {
    event.preventDefault();
    const formattedDate = moment(startDate).format("YYYY-MM-DD");
    const tripData = {
      startLocation,
      pickupLocation,
      dropoffLocation,
      currentCycleHours,
      startDate: formattedDate,
    };

    // console.log(
    //   JSON.stringify({
    //     startLocation,
    //     pickupLocation,
    //     dropoffLocation,
    //     currentCycleHours,
    //     startDate,
    //   })
    // );

    // First, check if trip exists
    const checkTripResponse = await fetch(
      "http://localhost:8000/api/trips/check_existing/",
      {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(tripData),
      }
    );

    const checkTripData = await checkTripResponse.json();
    onSubmit(tripData, checkTripData.exists, checkTripData.trip);
  };

  return (
    <Container>
      <h2>Enter Trip Details</h2>
      <Form onSubmit={handleSubmit}>
        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Start Location:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="text"
              placeholder="Enter start location"
              value={startLocation}
              //  onChange={(e) => setStartLocation(e.target.value)} Remove this
              readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Pickup Location:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="text"
              placeholder="Enter pickup location"
              value={pickupLocation}
              //   onChange={(e) => setPickupLocation(e.target.value)}  Remove this
              readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Dropoff Location:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="text"
              placeholder="Enter dropoff location"
              value={dropoffLocation}
              //   onChange={(e) => setDropoffLocation(e.target.value)} Remove this
              readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Current Cycle Hours:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="number"
              placeholder="Enter current cycle hours"
              value={currentCycleHours}
              //  onChange={(e) => setCurrentCycleHours(parseFloat(e.target.value))} Remove this
              readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Form.Group as={Row} className="mb-3">
          <Form.Label column sm={2}>
            Start Date:
          </Form.Label>
          <Col sm={10}>
            <Form.Control
              type="date"
              placeholder="Enter start date"
              value={startDate}
              //   onChange={(e) => setStartDate(e.target.value)} Remove this
              readOnly // Add this prop
            />
          </Col>
        </Form.Group>

        <Button variant="primary" type="submit">
          Generate Logs
        </Button>
      </Form>
    </Container>
  );
};

export default TripForm;
